package fonts

import "encoding/base64"

// The Noto Sans font encoded here is subject to the SIL Open Font License,
// Version 1.1
// http://scripts.sil.org/OFL

const notoSansRegularTTFBase64 = ``

var notoSansRegular []byte

func NotoSansRegularBytes() []byte {
	if len(notoSansRegular) == 0 {
		var err error
		notoSansRegular, err = base64.StdEncoding.DecodeString(notoSansRegularTTFBase64)
		if err != nil {
			panic(err)
		}
	}

	return notoSansRegular
}
